/* CSS Index 
- Sortable
- Side Bar
- Editor Controls
*/


body{
    margin: 0px;
}



/* Sortable */

.sortableList{
    min-height: 400px;
    widows: 100%;
}

.sortableList li{
    list-style: none;
}


/* Side Bar */ 

#sidebar-wrapper{
    width: 400px;
    position: fixed;
    left: -400px;
    top: 0px;
    background-color: rgb(51, 48, 48);
    transition: 1.5s;
    z-index: 99999;
}


#sidebar-wrapper li{
    list-style: none;
    float: left;
}

#sidebar-wrapper ul{
    padding: 0px;
    margin: 0px;
}

#sidebar-wrapper img{
    max-width: 180px;
    min-height: 150px;
    max-height: 150px;
    object-fit: contain;
    padding: 10px;
}

#sidebar-header{
    background-color: rgba(255, 0, 0, 0.637);
    color: white;
    padding: 20px;
}

#sidebar-button {
    position: absolute;
    right: -49px;
    width: 50px;
    text-align: center;
    border-top-right-radius: 10px;
    border-bottom-right-radius: 10px;
    height: 40px;
    top: 40%;
    color: white;
    background-color: #333030;
}

#sidebar-button .oi-cog {
    font-size: 25px;
    top: 20%;
}

#sidebar-footer {
    background-color: rgba(255, 0, 0, 0.637);
    color: white;
    padding: 20px;
    clear: both;
    position: absolute;
    bottom: 0px;
    width: 90%;
}

.ui-state-highlight{
    background-color: none !important;
    border: 5px dashed rgba(43, 43, 43, 0.308) !important;
    height: 100px;
    z-index: 99999;
}

/* Editor Controles */ 

#editor-controles {
    position: fixed;
    right: 30px;
    bottom: 40px;
}


#editor-controles li {
    list-style: none;
    float: left;
    padding: 10px;
    background-color: blue;
    border-radius: 50%;
    width: 25px;
    text-align: center;
    color: white;
    font-size: 15px;
    margin-right: 15px;
}


.droppable{
    min-height: 100px;
}


/* container buttons */

.container{
    border-left: 1px dashed rgba(43, 43, 43, 0.308) !important;
    border-right: 1px dashed rgba(43, 43, 43, 0.308) !important;
    border-bottom: 1px dashed rgba(43, 43, 43, 0.308) !important;
    position: relative;
    z-index: 1;
}

.container ul {
    position: absolute;
    right: 0px;
    width: 130px;
    margin: 0px;
    bottom: 0px;
}

.container li {
    float: left;
    background-color: blue;
    color: white;
    padding: 5px;
    margin-left: 10px;
}

li#binContainer, li#addContainer, li#addElement {
    background-color: #66636F;
}

li#addTextBlock {
    background-color: #FD2320;
}

#editor-controles {
    position: fixed;
    right: 30px;
    bottom: 40px;
    z-index: 999999;
}
